<script>
import { mapState, mapGetters, mapActions } from 'vuex'
import textWrap from 'svg-text-wrap'

export default {
  data() {
    return {
      title: 'Listado de Categorías'
    }
  },
  computed: {
    ...mapState('cards', ['cards']),
    ...mapGetters('cards', ['countCards'])
  },
  head() {
    return {
      title: this.title,
      meta: [
        { hid: 'og:title', name: 'og:title', content: 'My custom description' },
        {
          hid: 'og:description',
          name: 'og:description',
          content: 'My custom description'
        },
        { hid: 'og:image', name: 'og:image', content: 'My custom description' },
        { hid: 'og:url', name: 'og:url', content: 'My custom description' },
        {
          hid: 'description',
          name: 'description',
          content: 'My custom description'
        }
      ]
    }
  },
  created() {
    if (this.countCards === 0) {
      this.getAllCards()
    }
  },
  methods: {
    ...mapActions('cards', ['getAllCards']),
    wrap: function (text, width) {
      const textArray = textWrap(text, width, { 'letter-spacing': '1px' })
      return textArray
    }
  }
}
